import React from "react";
import PropTypes from "prop-types";
import { Field, Form } from "formik";
import Close from "components/Close";

const SearchForm = props => {
  return (
    <Form>
      <div className="relative">
        <Field
          name="searchString"
          className="shadow appearance-none border rounded w-full py-2 px-3 pr-7 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
        />
        <div className="cursor-pointer absolute inset-y-0 right-0 flex items-center px-2 text-gray-700">
          <Close className="fill-current h-4 w-4" />
        </div>
      </div>
    </Form>
  );
};

SearchForm.propTypes = {};

export default SearchForm;
